import React from "react";

import "./Main.scss";

import Header from "./components/Header";
import Profile from "./components/Profile";
import Board from "./components/Board";
import Footer from "./components/Footer";

const Main = (props) => {
  return (
    <>
      <Header />
      <main>
        <div>
          <Profile />
          <Board />
          <Footer />
        </div>
      </main>
    </>
  );
};

export default Main;
